import { Component } from "react";

export default class Event extends Component {
    constructor(props) {
        super(props);

        if (props.model) {
            this.state = props.model;
        }
    }

    componentDidMount() {
        if (!this.state) {
            this.setState({
                name: "event name",
                orgID: 2,
                description: "event description",
                startTime: new Date(),
                endTime: new Date(),
                tags: ["gaming", "greek"],
                created: new Date(),
                updated: new Date(),
            })
        }
